import Home from "./components/pages/home"
import TopBar from "./components/navbar/Navbar"
import { BrowserRouter as Router, Switch, Routes, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <TopBar />
      <Routes>
        <Home />
      </Routes>
    </Router>
  );
}

export default App;
